input = ''
def signalDetector9000(naHoeveel, input):
    for i in range(naHoeveel,len(input)-1):
        d = []
        for ii in range(0,(naHoeveel)):
            d.append(input[i-ii])
        if len([nummer for nummer in d if d.count(nummer) > 1]) == 0:
            print(i+1);break
signalDetector9000(4,input)
signalDetector9000(14,input)